import './Footer.css'

import insta from './insta.svg'

function Footer() {
    return (
        <footer>
            <img 
            src={insta}
            className="media-icon" 
            alt="insta-icon"></img>
        <img 
            src={github}
            className="media-icon" 
            alt="git-icon"></img>
        </footer>
    )
}

export default Footer;
